INSERT INTO `mod_tutoria` VALUES (1,1398913200,1399322461,0,NULL,'What do you think?',2,'',60,'This question interrupts us from telling too much. There is a place for direct instruction where we give students information yet we need to always strive to balance this with plenty of opportunities for students to make sense of and apply that new information using their schemata and understanding.',1),(2,1398913200,1399322461,0,NULL,'Why do you think that?',2,'',60,'After students share what they think, this follow-up question pushes them to provide reasoning for their thinking.',1),(3,1398913200,1399322461,0,NULL,'How do you know this?',2,'',60,'When this question is asked, students can make connections to their ideas and thoughts with things they\'ve experienced, read, and have seen.',1),(5,1398913200,1399322461,0,0,'What questions do you still have?',2,'',60,'This allows students to offer up questions they have about the information, ideas or the evidence.',1),(6,1399492130,NULL,0,0,'How many wood can a woodchuck chuck if a woodchuck could chuck wood?',2,'How many wood can a woodchuck chuck if a woodchuck could chuck wood?',NULL,NULL,0),(7,1399492147,NULL,0,0,'What is the Trinity to you?',2,'What is the Trinity to you?',NULL,NULL,0),(8,1400006284,NULL,0,0,'What is the meaning of life?',2,'What is the meaning of life?',NULL,NULL,0),(9,1434801970,NULL,0,0,'agenda de provas',437,'agenda de provas',NULL,NULL,0);
/*!40000 ALTER TABLE `mod_tutoria` ENABLE KEYS */;
